@kamu_j “ When you see your best friend at a ride😫😂 …. alright so some of you seen it already . I feel like a squid im sorry for everyone who witnessed me turn into a full blown squid Rocket and blast straight into the stratosphere 🤦🏻‍♂️🤦🏻‍♂️

Little backstory: I popped up full clear line of sight , But  when I dropped back to slow down ,I lost my line of sight and couldn’t see @itskittrickmann and the rest of the pack slowing down bcuz of a car . It’s my fault . I jus fucked up . But im glad we are both okay so glad @itskittrickmann came out untouched and glad I didn’t hurt anyone else but myself lol. but Thank you to everyone who came up to see if I was good I was in such a daze and I was winded I couldn’t answer everyone🙏 and shoutout to my sf boys for always holdin down and made sure I got back safe💯 love y’all 💪🏻 

Big shoutout to @k_sweezy_415 for capturing this📹😭😫 not my proudest moment but jus a reminder shit can happen to anyone an to keep an eye out .  I feel like a idiot . but end of the day im glad everyone was okay. 🙏 #iSuck “
